import { Button } from "@mui/material";
import { title } from "process";
import { FC } from "react";

interface Props{
    text:string
}

const MyButton:FC<Props> = ({text}) =>{
    return (
        <Button
            sx={{
                backgroundColor: 'red',    // Color de fondo inicial
                '&:hover': {
                backgroundColor: 'orange',  // Color de fondo al hacer hover
                transform: 'scale(1.05)',     // Le da un peque침o "zoom" al bot칩n
                transition: 'transform 0.3s ease-in-out', // Suaviza el cambio
                },
            }}
        >
            {text}
        </Button>
    );
}

export default MyButton
